} The desired_size method can be used to get the desired size of any element with text content (or some other dynamically sized content). This value is automatically cached by the element, so it is relatively inexpensive to call it over and over again if need be. Get the size of the window from the window context. Also convert that size into a rectangle for ease of use later (Yarrow uses euclid for geometric types). Create a rectangle that is centered inside of window_rect using the provided helper method. Set the bounding rectangle via the label element's handle. Note the .el in the middle. Every element handle has a generic el field with generic methods that are shared by all element types. For example, the generic el field also has a rect() method that can retrieve the current bounding rectangle of the element, which is very useful when the layout of some elements depend on the layout of other elements. Note that the same effect can be achieved by using the layout_aligned method on the Label handle: let window_rect = Rect::from_size(cx.logical_size());
self.hello_label.layout_aligned(window_rect.center(), Align2::CENTER, cx.res); No we must call the layout function after the main window is built and whenever the window resizes. To do this, add the following to the on_window_event trait method: fn on_window_event( &mut self, event: AppWindowEvent, window_id: WindowID, cx: &mut AppContext<Self::Action>,
) { match event { AppWindowEvent::WindowOpened => { if window_id == MAIN_WINDOW { let mut main_window_cx = cx.window_context(MAIN_WINDOW).unwrap(); self.main_window_elements = Some(MainWindowElements::build(&mut main_window_cx)); // new self.main_window_elements .as_mut() .unwrap() .layout(&mut main_window_cx); } } // new AppWindowEvent::WindowResized => { if window_id == MAIN_WINDOW { let mut main_window_cx = cx.window_context(MAIN_WINDOW).unwrap(); self.main_window_elements .as_mut() .unwrap() .layout(&mut main_window_cx); } } _ => {} }
} Now the label stays in the center of the window! Centered Label

